import React from 'react';
import ReactDOM from 'react-dom';
function Car(props) {
    return <li>I am a { props.brand }</li>;
  }

  function MyForm() {
    return (
      <form>
        <label>Enter your name:
          <input type="text" />
        </label>
      </form>
    )
  }
  ReactDOM.render(<MyForm />, document.getElementById('root'));

